(17, 'UiPath', 'Webinar', 'TAM Talks: UiPath Agent Builder Advance Topics ', 'This webinar is designed for UiPath practitioners, COE teams, and tech leaders looking to deepen their understanding of Agent Builder and its role in intelligent automation.', '2025-08-14 00:00:00', NULL, NULL, 'https://start.uipath.com/TAM-Tech-Talks-Agent-Builder.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
