(20, 'UiPath', 'Webinar', 'Agentic Automation Summit ANZ <br> On-Demand webinar', 'Register now to watch the on-demand webinar from the UiPath Agentic Automation Summit in Sydney to explore explore how AI, robots, and people drive change.', '2025-07-28 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/agentic-automation-summit-anz', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(21, 'UiPath', 'Webinar', 'Innovate and enhance decision quality with UiPath Process Mining: Redefining business processes', 'Empower business innovation and efficiency.', '2025-07-23 00:00:00', NULL, NULL, 'https://start.uipath.com/Innovate-and-Enhance-Decision-Quality-with-UiPath-Process-Mining.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(22, 'UiPath', 'Webinar', 'The New Tools for Intelligent Testing: UiPath Test Cloud and Deloitte', 'Are you ready to transform your testing approach with intelligent automation? Join us for an insightful webinar featuring UiPath and Deloitte experts as we unveil the future of testing.', '2025-07-21 00:00:00', NULL, NULL, 'https://start.uipath.com/UiPath-Test-Cloud-and-Deloitte.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(23, 'UiPath', 'Webinar', 'Transforming Document Operations in Insurance', 'Transformation in the insurance industry has long been impeded by the challenges of unstructured and highly variable documents. Downstream lines of business struggle to improve processes when they first need to categorize, ingest, and enrich a myriad of incoming document types, formats, and content varieties.', '2025-07-21 00:00:00', NULL, NULL, 'https://start.uipath.com/Transforming-Document-Operations-in-Insurance.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(24, 'UiPath', 'Webinar', 'Revolutionize Oracle Testing with Agentic AI in UiPath Test Cloud', 'This webinar explores how UiPath Test Cloud brings intelligent, agentic testing to Oracle environments combining AI-powered test generation, resilient automation, and seamless DevOps integration.', '2025-07-18 00:00:00', NULL, NULL, 'https://start.uipath.com/Revolutionize-Oracle-Testing-with-Agentic-AI-in-UiPath-Test-Cloud.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(25, 'UiPath', 'Webinar', 'Transform Unstructured Documents with Agentic Automation', 'In this session, you\'ll see how to apply UCD across use cases like contract analysis and multi-table layouts, then connect that data into end-to-end automations using UiPath Agent Builder.', '2025-07-18 00:00:00', NULL, NULL, 'https://start.uipath.com/Transform-Unstructured-Documents-with-Agentic-Automation.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(26, 'UiPath', 'Webinar', 'Transform Your Automation Journey with Healing Agent Technology', 'In this engaging webinar, learn how our innovative Healing Agent technology transforms your automation processes by actively identifying and remedying issues before they impact your operations. Join industry experts as they share hands-on insights, best practices, and real-world success stories that will empower you to achieve greater system resilience and efficiency.', '2025-07-18 00:00:00', NULL, NULL, 'https://start.uipath.com/TAM-Talks-Healing-Agent.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(27, 'UiPath', 'Webinar', 'Winning the Denials Battle with Agentic Automation: Speeding Up Appeals and Protecting Revenue', 'Join us and discover how agentic automation reduces denials, accelerates appeals, and improves financial outcomes.', '2025-07-18 00:00:00', NULL, NULL, 'https://start.uipath.com/Winning-the-Denials-Battle.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(28, 'UiPath', 'Webinar', 'From 40 minutes to 5: a new era in paediatric referrals', 'Ada, a digital worker at Cambridgeshire Community Services NHS Trust (CCS NHST), has transformed the way paediatric referrals are processed.', '2025-07-02 00:00:00', NULL, NULL, 'https://start.uipath.com/cambridge-NHS.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(29, 'UiPath', 'Webinar', 'The Next Era of AML: Powered by Agentic AI', 'Join us to hear from our industry experts as they explore how AI-driven autonomy enhances compliance workflows, reduces false positives, and strengthens fraud detection mechanisms - all while minimizing operational burdens.', '2025-07-02 00:00:00', NULL, NULL, 'https://start.uipath.com/the-next-era-of-aml.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(30, 'UiPath', 'Webinar', 'Demystifying AI & agentic automation in BFS contact centers & CX teams', 'Watch the on-demand webinar and learn from Rufino Chiong, EMEA Practice Director, CX and Contact Centers at UiPath, Scott Dresser, Contact Center Expert at UiPath, and Sai Vijayendra Madiga, Global Practice Lead for AI at Roboyo, how BFS organizations can go beyond the hype and implement agentic AI with purpose, clarity, and measurable ROI.', '2025-06-30 00:00:00', NULL, NULL, 'https://start.uipath.com/Customer-Experience-Webinar.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(31, 'UiPath', 'Webinar', 'Transform your testing with agentic testing powered by UiPath Test Cloud', 'Join us for an exclusive webinar exploring how UiPath Test Cloud leverages its enterprise-grade automation platform to achieve what many testing tools only promise in demos. In today’s complex IT environments spanning citrix, web, desktop, mobile, and APIs, most solutions break down at scale, struggle with test data management, or falter under change pressure.', '2025-06-26 00:00:00', NULL, NULL, 'https://start.uipath.com/Transform-your-testing-with-agentic-testing-powered-by-UiPath-Test-Cloud.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(32, 'UiPath', 'Webinar', 'Smarter Pricing in Retail: Adapting to Tariffs and Volatility with Agentic AI ', 'Watch this webinar to learn how retailers are using agentic AI to tackle tariffs, demand shifts, and pricing volatility with smarter, adaptive automation.', '2025-06-19 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/smarter-retail-pricing-with-agentic-ai', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(33, 'UiPath', 'Webinar', 'Revolutionize SAP and Oracle Testing with Agentic AI', 'Learn how UiPath Test Cloud is redefining software testing with AI agents intelligent automation, and zero infrastructure burden built to handle the complexities of large-scale integrated systems like SAP, Oracle, and more.', '2025-06-18 00:00:00', NULL, NULL, 'https://start.uipath.com/Revolutionize-SAP-and-Oracle-Testing-with-Agentic-AI.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(34, 'UiPath', 'Webinar', 'Agentic Automation for Healthcare Payers: A New Era Begins', 'Join UiPath to see how the UiPath Platform for Agentic Automation brings together agents that think, robots that do, and people who lead to transform the way payer operations run. This isn’t about theory. It’s about what’s possible now.', '2025-06-13 00:00:00', NULL, NULL, 'https://start.uipath.com/Agentic-Automation-for-Healthcare-Payers.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
