(36, 'UiPath', 'Webinar', 'Revolutionize Software Testing for Salesforce and Core Applications', 'In this webinar, you\'ll discover how you can transform your software testing with agentic testing powered by UiPath Test Cloud, accelerating testing for critical core applications like Salesforce, Episys, and Guidewire.', '2025-05-09 00:00:00', NULL, NULL, 'https://start.uipath.com/Unleash-Agentic-Testing-with-UiPath-Test-Cloud.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(37, 'UiPath', 'Webinar', 'How the HSE transformed healthcare by saving over 800,000 hours of manual work', 'Since 2019, the Health Service Executive (HSE) Ireland has automated over 50 processes - delivering efficiency gains equivalent to 800,000 hours of manual work with a total value of €30 million.', '2025-05-09 00:00:00', NULL, NULL, 'https://start.uipath.com/health-service-executive-ireland.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
