(42, 'UiPath', 'Webinar', 'From Gaps to Gains: How Automation Transforms Care Gaps Management', 'Join our upcoming webinar to see how UiPath’s Clinical Care Gaps solution uses AI-powered automation to streamline the process, improve patient outcomes, ensure compliance, and save valuable time. We\'ll also demonstrate how the solution works in real-time.', '2025-03-18 00:00:00', NULL, NULL, 'https://start.uipath.com/Care-Gaps-Management.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(43, 'UiPath', 'Webinar', 'Navigating the New Era of Trade Compliance', 'UiPath\'s HTS Code Classifier leverages Agentic Automation and Document Understanding to streamline and improve the accuracy of Harmonized Tariff Schedule (HTS) code classification for international trade compliance. This solution automates the verification of HTS codes by ingesting commercial invoices and using an AI-driven \"HTS Code Verifier\" agent to apply the General Rules of Interpretation for classification.', '2025-03-17 00:00:00', NULL, NULL, 'https://start.uipath.com/Navigating-the-New-Era-of-Trade-Compliance.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(44, 'UiPath', 'Webinar', 'The state of financial services automation', 'The financial services industry is at a pivotal moment in 2025. Banks, regional banks, and capital markets firms are facing a rapidly evolving regulatory and technological landscape. In this webinar, we’ll dive into these trends and explore how automation and agentic solutions are empowering financial institutions to stay ahead of challenges and drive success.', '2025-03-10 00:00:00', NULL, NULL, 'https://start.uipath.com/The-state-of-financial-services-automation.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(45, 'UiPath', 'Webinar', 'The state of insurance automation', 'Gain insights into how automation is not just a trend but a necessity for the insurance industry in 2025. Learn how RPA, automation, AI, and agents are helping insurers adapt to change, improve customer experience, and stay competitive in a rapidly evolving landscape.', '2025-03-10 00:00:00', NULL, NULL, 'https://start.uipath.com/The-state-of-insurance-automation.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(46, 'UiPath', 'Webinar', 'Driving AI-Led Innovation in Regional Banks', 'The discussion will focus on themes where agentic automation transcends conventional automation by leveraging artificial intelligence (AI), machine learning (ML), and robotic process automation (RPA).', '2025-03-10 00:00:00', NULL, NULL, 'https://start.uipath.com/Advancing-AI-led-innovation-in-banking.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
