(143, 'UiPath', 'Webinar', 'End to End Automation: A Game Changer for Improving Workforce Efficiency', 'As enterprises seek to automate more of their knowledge work and repetitive processes, they’re looking for new ways to leverage technology to speed and streamline the effort. Traditionally, these challenges have been addressed individually with a variety of different automation strategies, but increasingly businesses are integrating their automation efforts into a single approach that is easier to manage, less costly, and more effective.​', '2021-10-28 00:00:00', NULL, NULL, 'https://start.uipath.com/End-to-End-Automation-A-Game-Changer-for-Improving-Workforce-Efficiency.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
