(148, 'UiPath', 'Webinar', 'CIAC | Clinical Intelligent Automation Council', 'CIAC was created to spark a healthcare transformation at its clinical core. Our goals are to increase the speed of positive patient outcomes while reducing costs and protecting revenue through the application of intelligent automation, ML & AI. Through this council, we hope to develop potential clinical automation solutions and gain industry support to build and deploy. The healthcare industry has made tremendous progress in its transformation in recent years largely due to the adoption of intelligent automation (AI/ML + robotic process automation). Healthcare providers and payers have realized millions of dollars in returns from reduced costs, increased revenue and cash flow, and quality improvements in several key areas such as RCM, finance, IT, HR, and supply chain. However, significant opportunities for the same types of transformation and returns still exist in the clinical/operations space. In this session you’ll hear directly from industry clinical and automation executives and experts regarding clinical intelligent automation ideas, advancements, and solutions in many of these and other areas:· Speeding Time to Treatment for High-Risk Patients · Avoiding HACs, Negative DI Trending, and Early Readmissions · Reducing Surgical Waste · Improving Patient Outcomes ModeratorsJason Warrelmann – Global Healthcare & Lifesciences Lead, UiPath Jeff Hatfield – VP Intelligent Healthcare Automation, Ashling Partners AudienceJoin leaders in the industry including CTOs, Transformation Officers, Chief Medical Officers, Chief Nursing Officers, Chief Patient Quality Officers, and many more during our virtual event.', '2021-07-23 00:00:00', NULL, NULL, 'https://go.ashlingpartners.com/ciac-on-demand?utm_source=website&utm_medium=website&utm_campaign=CIAC+Webinar&utm_id=PW21CIAC', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
