(155, 'UiPath', 'Webinar', 'Think Before You Automate - Singapore', 'RPA gives us amazing capabilities to automate how things get done. However, automating a broken or inefficient process will result in disappointment. We talk about intelligent automation, but should that also include that we apply some intelligence before we automate the process? What makes successful Solution Architects and RPA Developers stand out is their ability to not just automate, but also find ways to improve the process they are automating. In this event, you will learn ways to assess how good a process performs, and ways to make improvements.', '2021-05-18 00:00:00', NULL, NULL, 'https://communityevents.uipath.com/events/details/uipath-singapore-presents-think-before-you-automate/', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
