(163, 'UiPath', 'Webinar', 'Coffee Chat with NHS Shared Business Services', 'Our ‘Coffee Chat’ series is an interactive webinar featuring UiPath customers and conducted in an interview format. Join UiPath and Mathieu Webster, Transformation Lead at NHS SBS, over a cup of coffee (or tea if you prefer) to discuss the challenges, opportunities and know-how of automation.', '2021-01-26 00:00:00', NULL, NULL, 'https://start.uipath.com/webinar-coffee-chat-nhs-sbs.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(164, 'UiPath', 'Webinar', 'Maximize SAP Investments with UiPath Automation and Testing ', 'In this webinar, explore how UiPath technology lets you deploy automation across your SAP and non-SAP systems while best-of-breed testing capabilities allow optimizing your critical end-to-end business processes.', '2021-01-21 00:00:00', NULL, NULL, 'https://start.uipath.com/wbn-sap-test-automation.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(165, 'UiPath', 'Webinar', 'Improving Software Robots and Application Resilience', 'After more than 20 years of automated testing, teams still struggle to keep up with schedules, application changes and test coverage. Register to see what unique capabilities the UiPath Test Suite provides to overcome the challenges, whether you are testing applications or automating business processes.', '2020-12-14 00:00:00', NULL, NULL, 'https://start.uipath.com/test-automation-webinar-series-session-1-test-automation-techtalk.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(166, 'UiPath', 'Webinar', 'Improving Software Robots and Application Resilience', 'After 20+ years of automated testing, teams still struggle to keep up with schedules, application changes and test coverage. Join this webinar to see what unique capabilities the UiPath Test Suite provides to overcome the challenges, whether you are testing applications or automating business processes.', '2020-12-10 00:00:00', NULL, NULL, 'https://start.uipath.com/test-automation-webinar-series-session-1-test-automation-techtalk.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(167, 'UiPath', 'Webinar', 'How \'a Robot for Every Person\' is Maximizing Returns From ERP Investments at EY', 'Hear from Simon Constance, Partner at Ernst & Young (EMEIA) Services Limited, on how the company is empowering their professionals to work smarter with one of the largest attended automation deployments from UiPath in the world.', '2020-12-08 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/maximising-returns-erp-ey', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(168, 'UiPath', 'Webinar', 'Boosting Legal Innovation through Process Automation ', 'In this joint webinar with the European Company Lawyers Association (ECLA), we will explain what RPA is, how UiPath Legal team created its first legal robots and how you can apply the same technology and approach to your own legal and compliance processes.', '2020-12-03 00:00:00', NULL, NULL, 'https://start.uipath.com/wbn-boosting-legal-innovation-through-automation.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(169, 'UiPath', 'Webinar', 'Process Automation with Digital Transformation (Partner: SoftwareONE)+2:170', 'In this informal fireside chat, moderated by UiPath, you will hear from executives from Bajaj Allianz, Eureka Forbes and Hitachi Sunway Information Systems.', '2020-11-25 00:00:00', NULL, NULL, 'https://www.softwareone.com/en/webinars/2020/11/05/process-automation-with-digital-transformation', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(170, 'UiPath', 'Webinar', 'The Fully Automated Enterprise (Partner: SoftwareONE)', 'In this informal fireside chat, moderated by UiPath, you will hear from executives from Active Exhaust Corp, Electro Rent, and Corporate Momentum.', '2020-11-25 00:00:00', NULL, NULL, 'https://www.softwareone.com/en/webinars/2020/11/06/the-fully-automated-enterprise', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(171, 'UiPath', 'Webinar', 'Coffee Chat with DHL', 'In this Coffee Chat, Dr. Frank Schüler (Managing Director Global Services Centre) and Vini Kolathur (Center Head, Chennai & VDC (GSC)) from DHL Global Forwarding Freight give us deep insights into DHL\'s automation journey.', '2020-09-24 00:00:00', NULL, NULL, 'https://start.uipath.com/webinar-EMEA-Coffee-Chat-with-DHL.html', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
