(178, 'UiPath', 'Webinar', 'Webinar: A Robot for Every Person: Stories from Users, Citizen Developers & CoE’s', 'Join this webinar to learn how the COVID-19 pandemic has changed the way companies operate and how companies see automation in the context of risk mitigation and strategic investment as part of their recovery process.', '2019-01-01 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/robot-for-every-person-national', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(179, 'UiPath', 'Webinar', 'In 3 Simple Steps from Automation  Idea to Robot', 'Join our webinar series across three 30-minute sessions as we take you from idea to robot in three easy steps.', '2019-01-01 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/in-three-ways-from-idea-to-robots', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(180, 'UiPath', 'Webinar', 'Webinar:  How to build a business case for RPA using Automation Hub', 'The best ideas can come from anywhere in a business. And this also holds true for automation ideas. So why not learn how to build your own automation for the day-to-day, tedious and repetitive tasks? Not a developer? No problem!', '2019-01-01 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/business-case-rpa-automation-hub', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(181, 'UiPath', 'Webinar', 'Webinar: Forrester Research Featured on the Impact of the Current Global Crisis and Automation ', 'Join us for a week of practical content and approaches to help you scale your organization’s automation program. Get an overview of the scaling framework on Day 1, followed by deep dives into specific topics for the rest of the week.', '2019-01-01 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/forrester-research-impact-crisis-automation', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(182, 'UiPath', 'Webinar', 'Webinar: UiPath Process Mining: Understanding the Value of Scientific Process Analysis', 'Join us on this webinar to learn more \"a robot for every person\" - our vision for the modern workplace in which companies enable employees to use, create, and benefit from automation.', '2019-01-01 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/explore-customers-process-mining', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(183, 'UiPath', 'Webinar', 'Webinar: Automation at Light Speed', 'Uncover best practices around topics such as task mining, scaling through citizen-led models, & other considerations around governance, risk & operations.', '2019-01-01 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/automation-at-light-speed', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
