(186, 'UiPath', 'Webinar', 'Webinar: How Banks are Delivering Lightning Fast SBA Loan Approvals at Scale with Automation', 'Join the webinar to explore how RPA and AI can transform the way companies do business, create new opportunities for growth, collaboration, and increased productivity.', '2019-01-01 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/fast-sba-loan-approvals-automation', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
