(190, 'UiPath', 'Webinar', 'UiPath and Coca-Cola İçecek: The Alchemy of an Automation Culture', 'Experience how RPA can accelerate your S/4 HANA future! Through real-world examples, learn how to minimize the cost and disruption to daily business during your migration.', '2019-01-01 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/uipath-coca-cola-icecek-automation-culture', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
