(192, 'UiPath', 'Webinar', 'Webinar: Reduce the Economic impact of COVID-19 through Hyperautomation ', 'the novel coronavirus (covid-19) has now become a global pandemic and is having a devastating impact on businesses across industries. the trade impact of covid-19 for india is estimated to cost about 348 million dollars and we are also among the top 15 economies as per a united nations (un) report, to be most affected as the slowdown of manufacturing in china looms large. india inc needs to prepare for a “potential” recession in case this downward spiral continues. automation of several key processes can help alleviate many issues and the uipath intelligent end-to-end automation platform is fully equipped to support you through these challenging times. agenda topics covid-19 impact: industry perspective industry implications: impact across segments how automation can help to manage the way forward how and where uipath robots can solve specific business problems insights from subject matter experts', '2019-01-01 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/webinar-covidindia', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(193, 'UiPath', 'Webinar', 'Webinar: Virtual Executive Roundtable Denmark ', 'this is an ideal opportunity to discuss what works well, what are your main challenges in implementing rpa and learn how your peers are coping with their digital journey in what has become a massively changed working environment. to facilitate a lively discussion, (prior to the session) please have a think about the following: on a scale from 1 to 10, where you would rate the maturity of your enterprise automation and why (1 being at pilot stage, and 10 having a full hyper automation deployment of rpa plus ai tools in production (there are only a handful of companies in the world that are at 10, so don’t worry)? what are the main challenges you face in scaling rpa? and what are your recommendations to other companies on how to tackle them? what impact is covid-19 having on your business today and what you are your plans for your business after the pandemic? as well as guy, we also have the pleasure of introducing telenor, who will share their rpa journey with us. agenda:10.30 introduction by per sølvager, regional vp of uipath nordics (agenda and attendees)10:40 telenor rpa journey by martin yepes ravn, head of operation center technology10.50 discussion around the three topics11.25 final thoughts from guy11.30 thank you under normal circumstances we would have served you a nice lunch or similar – so going virtual we will have a delicate meeting snack package send to your office or home address, depending on your preference, for you to enjoy during the event. the whole uipath team look forward to seeing you there!', '2019-01-01 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/executive-roundtable-automation-rpa', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(194, 'UiPath', 'Webinar', 'Webinar: Virtual Executive Roundtable Finland ', 'this is a personal invitation for our virtual executive roundtable event where we have invited our emea senior vice president at uipath, gavin jackson. this is an ideal opportunity to discuss what works well, what are your main challenges in implementing rpa and learn how your peers are coping with their digital journey in what has become a massively changed working environment. to facilitate a lively discussion, (prior to the session) please have a think about the following: on a scale from 1 to 10, where you would rate the maturity of your enterprise automation and why (1 being at pilot stage, and 10 having a full hyper automation deployment of rpa plus ai tools in production (there are only a handful of companies in the world that are at 10, so don’t worry)? what are the main challenges you face in scaling rpa? and what are your recommendations to other companies on how to tackle them? what impact is covid-19 having on your business today and what you are your plans for your business after the pandemic? on the agenda we also have the pleasure of introducing palkeet, who will share their rpa journey with us. agenda:12.30 introduction by per sølvager, regional vp of nordics (agenda and attendees)12:40 palkeet rpa journey by eija hartikainen, development manager, digitalisation12.50 discussion around the three topics with gavin as moderator13.25 final thoughts and wrap up by gavin under normal circumstances we would have served you a nice lunch or similar – so going virtual we will have a delicate meeting snack package send to your office or home address, depending on your preference, for you to enjoy during the event. the uipath team look forward to seeing you there!', '2019-01-01 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/executive-roundtable-automation-rpa-finland', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
