(196, 'UiPath', 'Webinar', 'UiPath 21.4 Release for Enterprise-Scale Automation', 'UiPath 21.4 release adds several significant new products, new features and customer-driven improvements across key automation personas.', '2019-01-01 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/2021-hk-21-4-release', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
