(200, 'UiPath', 'Webinar', 'Webinar: Enbridge Embarks on Digital Transformation Journey Leveraging RPA', 'Tune in to hear how Enbridge is on track to scaling RPA across multiple functions.', '2019-01-01 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/join-enbridge-on-rpa', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
