(202, 'UiPath', 'Webinar', 'Webinar: Virtual Executive Roundtable Sweden ', 'this is a personal invitation for our executive virtual roundtable event where we have invited our chief evangelist at uipath, guy kirkwood. this is an ideal opportunity to discuss what works well, what are your main challenges in implementing rpa and learn how your peers are coping with their digital journey in what has become a massively changed working environment. to facilitate a lively discussion, (prior to the session) please have a think about the following: on a scale from 1 to 10, where you would rate the maturity of your enterprise automation and why (1 being at pilot stage, and 10 having a full hyper automation deployment of rpa plus ai tools in production (there are only a handful of companies in the world that are at 10, so don’t worry)? what are the main challenges you face in scaling rpa? and what are your recommendations to other companies on how to tackle them? what impact is covid-19 having on your business today and what you are your plans for your business after the pandemic? on the agenda we also have the pleasure of introducing postnord, who will share their rpa journey with us. agenda:13.00 introduction by per sølvager, regional vp of nordics (agenda and attendees)13:10 postnord rpa journey by anne-christine lane, vp/head of analytics & automation13:20 discussion around the three topics with guy as moderator13.55 final thoughts and wrap up by guy under normal circumstances we would have served you a nice lunch or similar – so going virtual we will have a delicate meeting snack package send to your office or home address, depending on your preference, for you to enjoy during the event. the uipath team look forward to seeing you there!', '2019-01-01 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/executive-roundtable-automation-rpa-sweden', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(203, 'UiPath', 'Webinar', 'Webinar: Virtual Executive Roundtable Norway ', 'this is a personal invitation for our executive virtual roundtable event where we have invited guy kirkwood, our chief evangelist at uipath. this is an ideal opportunity to discuss what works well, what are your main challenges in implementing rpa and learn how your peers are coping with their digital journey in what has become a massively changed working environment. to facilitate a lively discussion, (prior to the session) please have a think about the following: on a scale from 1 to 10, where you would rate the maturity of your enterprise automation and why (1 being at pilot stage, and 10 having a full hyper automation deployment of rpa plus ai tools in production (there are only a handful of companies in the world that are at 10, so don’t worry)? what are the main challenges you face in scaling rpa? and what are your recommendations to other companies on how to tackle them? what impact is covid-19 having on your business today and what you are your plans for your business after the pandemic? as well as guy, we also have the pleasure of introducing nav, who will share their rpa journey with us. agenda:12.30 introduction by kim knudsen, sales manager, nordics (agenda and attendees)12:40 nav rpa journey by maria recio, team manager, department for rpa12.50 discussion around the three topics with guy as moderator13.25 final thoughts from guy13.30 thank you under normal circumstances we would have served you a nice lunch or similar – so going virtual we will have a delicate meeting snack package send to your office or home address, depending on your preference, for you to enjoy during the event. the uipath team look forward to seeing you there!', '2019-01-01 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/executive-roundtable-automation-rpa-norway', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(204, 'UiPath', 'Webinar', 'Webinar: EMEA Partner Mastermind Series', 'the automation first era of enterprise technology is here. we invite you to attend our partner masterminds webinars, a webcast series specifically designed to provide insights into how we\'re aligning with our partners to impact the future of work. this webinar will showcase how uipath plans to collaborate with partners to identify, pursue, and win new business in the post covid-19 time. don’t miss out!', '2019-01-01 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/emea-partner-mastermind', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
(205, 'UiPath', 'Webinar', 'EMEA Virtual Customers Roundtable: Automation in the Fast-Changing World ', 'uipath is hosting a series of online roundtables for our customers in the emea region. we want to provide an opportunity for our valued customers to interact with each other and discuss their automation journeys, opportunities and best practices. chaired by guy kirkwood, chief evangelist at uipath, these roundtables will be highly interactive and dynamic. it will be about you - our customers – your point of views and stories, not uipath. the june edition of the roundtable will focus on the topic ‘automation in the fast-changing world’ and these questions: what is your organization doing to adapt to the extraordinary circumstances? where do you see the increased demand for automation? how are you scaling the automation efforts? what are the key lessons learned? and what’s next? please note that the participation of the roundtable is strictly reserved for uipath customers in emea.', '2019-01-01 00:00:00', NULL, NULL, 'https://www.uipath.comresources/automation-webinars/emea-customers-fast-changing-world', '2025-10-30 11:31:03', '2025-10-30 11:31:03'),
