(727, 'AWS', 'Webinar', 'The Seattle Central Library and AWS Skills Center Seattle Presents:  “Discover Careers in AWS Cloud” ', 'Join us for a day of discovery centering careers in AWS cloud! You may attend one or all sessions: Meet with an Amazon Web Services (AWS) Trainer to learn about the cloud model and its core services, learn about careers in the cloud, and the process to become AWS Certified. Attend one or more of the 1-hr sessions. Introduction to the Cloud 10:30AM, Job Roles in the Cloud 12:00, Build a Cloud Career 1:30PM, Why Get AWS Certified 3:00PM. 📍 Location: Central Library 1000 Fourth Ave, Seattle, WA 98101 206-386-4636 Google map directions Level 4 - Room 1 📅 Thursday November 6, 10:30am-4:00pm Introduction to the Cloud 10:30am-11:30am PST Job Roles in the Cloud 12:00pm-1:00pm PST Building a Cloud Career 1:30pm-2:30pm PST Why Get AWS Certified 3:00pm-4:00pm PST 🎟️ Free and Open to the Public, Registration is required Questions? Reach out to our team! Contact: aws-skills-center-seattle@amazon.com Phone: 206-653-3874 Come meet the AWS Skills Center team. Free admission - All are welcome!', '2025-09-22 18:04:05', '2025-10-27 15:17:53', NULL, 'https://www.spl.org/event-calendar?trumbaEmbed=view%3Devent%26eventid%3D190127331', '2025-10-30 11:31:04', '2025-10-30 11:31:04'),
(728, 'AWS', 'Webinar', 'Next-GEn Fraud Protection: Outpacing Fraud, Enhancing Experience', 'Join us for an exclusive webinar and discover the ways top institutions use cloud-based communications APIs to outsmart fraudsters and delight customers.', '2025-10-27 14:12:48', '2025-10-27 14:12:49', NULL, 'https://event.on24.com/wcc/r/5098233/B71786701049DA4D7B4DF9794FA0F252', '2025-10-30 11:31:04', '2025-10-30 11:31:04'),
(729, 'AWS', 'Webinar', 'AWS Skills Center Seattle 4th Anniversary Celebration ', 'S🎉 AWS Skills Center Seattle 4th Anniversary Celebration 🎉 Come Celebrate 4 AWSome Years with Us! AWS Skills Center Seattle is celebrating it’s fourth birthday and you are ALL invited! 🔥 Four incredible years. Thousands of success stories. ONE epic celebration. 🎤 Keynote Speaker→ Hear from AWS Chief Techfluencer Rudy Chetty 🤝 Network with friends and colleagues→ Connect with your community 🍽️ Amazing food and drinks provided 🎁 Raffle prizes→ Win prizes throughout the night 🎂 Trivia and of course cake! Can\'t make it in-person? Attend the session virtually at 5:00pm by registering here: https://www.aws.training/learningobject/ilt?id=167503 This isn\'t just our anniversary - it\'s OUR success celebration! This is a public event open to everyone - for free For more information, please visit our website: AWS Skills Center website Day of Details: Thursday November 20th Time: 4:00 PM - 7:00 PM Location: Amazon SEA81 Oscar Building, 2nd Floor 1007 Stewart St, Seattle, WA 98101 Questions? Reach out to our team! Contact: aws-skills-center-seattle@amazon.com Phone: 206-653-3874 Come meet the AWS Skills Center team. Free admission - All are welcome!', '2025-10-24 17:04:04', '2025-10-24 17:04:05', NULL, 'https://pulse.aws/survey/LOLZYMRD', '2025-10-30 11:31:04', '2025-10-30 11:31:04'),
(730, 'AWS', 'Webinar', 'Improve outcomes with purpose-built data warehouses', 'Learn how healthcare organizations can implement purpose-built data warehouses to become more agile and data driven in their decision-making across every aspect of care delivery ranging from improving patient and provider experiences to improving quality of care and reducing healthcare costs.', '2025-06-13 20:21:42', '2025-10-16 16:54:32', NULL, 'https://event.on24.com/wcc/r/3352796/A2B1E6DF40AF39D623435D95EBC6811E?did=ep_card&trk=ep_card', '2025-10-30 11:31:04', '2025-10-30 11:31:04'),
(731, 'AWS', 'Webinar', 'Accelerate Business Transformation with SAP on AWS', 'Organizations across every industry want to become more agile so they can innovate and respond to changes faster. Faced with every-increasing disruption, evolving market demands, and global compliance needs, they must also find ways to differentiate their businesses to stay competitive. In this webinar, you\'ll learn the key drivers for moving your workloads to the cloud, how to cut costs and increase organizational agility, and how real AWS and Syntax customers migrated their workloads to accomplish both.', '2025-06-13 20:21:25', '2025-10-16 16:54:26', NULL, 'https://pages.awscloud.com/OE-Accelerate-Business-Transformation-with-SAP-on-AWS-register.html', '2025-10-30 11:31:04', '2025-10-30 11:31:04'),
(732, 'AWS', 'Webinar', 'Get Started with Computer Vision for Quality Inspection, with Amazon Lookout for Vision', 'Learn how Amazon Lookout for Vision allows you to automate visual inspection, with no machine learning experience required.', '2025-06-13 20:32:20', '2025-10-14 20:08:17', NULL, 'https://pages.awscloud.com/Get-Started-with-Computer-Vision-for-Quality-Inspection-with-Amazon-Lookout-for-Vision_2021_0320-MCL_OD.html', '2025-10-30 11:31:04', '2025-10-30 11:31:04'),
(733, 'AWS', 'Webinar', 'Analytics in 15: Automatically Provision and Scale OpenSearch with AWS', 'See how new features of Amazon OpenSearch Service can help you scale workloads without overprovisioning.', '2025-06-13 20:30:04', '2025-10-14 20:08:15', NULL, 'https://pages.awscloud.com/Analytics-in-15-Automatically-Provision-and-Scale-OpenSearch-with-AWS_2023_0312-SN-ABD_OD?did=ep_card-reg&amp;did=ep_card&trk=ep_card-ep_card-reg-b3950556-6979-4000-b234-da3e16725e30&amp;sc_channel=el', '2025-10-30 11:31:04', '2025-10-30 11:31:04'),
(734, 'AWS', 'Webinar', 'Embrace Change: Adapt Your Business with GenAI Solutions on AWS', '\"Embrace Change - Adapt Your Business with GenAI Solutions on AWS\" webinar, where we\'ll explore how Generative AI can transform your business. We\'ll introduce key AWS services like AWS Bedrock, AWS Lambda, Amazon S3, Amazon Textract, and Amazon Q to showcase LawGini, an AI-powered legal assistant developed using these services. Learn through a real-world use case we developed for a well-known law firm with LawGini, hear success stories, and get your questions answered in our interactive Q&A session.', '2025-06-13 20:24:56', '2025-10-14 20:08:14', NULL, 'https://www.ittstar.com/transform-business-using-genai-solutions-webinar?did=ep_card&trk=ep_card', '2025-10-30 11:31:04', '2025-10-30 11:31:04'),
(970, 'UiPath', 'Webinar', 'Streamlining Referrals with Agentic Automation: Accelerating Speed, Accuracy & Patient Care', 'Join us to discover how agentic automation transforms referrals management—eliminating delays, improving data accuracy, and enhancing the patient experience.', NULL, NULL, NULL, 'https://start.uipath.com/Streamlining-Referrals.html', '2025-10-30 11:31:04', '2025-10-30 11:31:04'),
(971, 'UiPath', 'Webinar', 'Delivering value with AI: How to get from Now to Next?', 'Join us for an insightful webinar where we will uncover the dynamic role of AI in this sector. See what\'s coming with our experts as they share their ideas about new AI products and ways to reduce risks while moving forward confidently. This webinar will have Ed Challis, Ph.D., who is the head of AI strategy at UiPath, and Malcolm deMayo, who is the Global VP of Financial Services at NVIDIA. They will talk about current applications and future innovations.', NULL, NULL, NULL, 'https://start.uipath.com/Delivering-value-with-AI.html', '2025-10-30 11:31:04', '2025-10-30 11:31:04'),
(972, 'UiPath', 'Webinar', 'Intelligent Automation Trends in Retail', 'Customers will understand the top areas to leverage GenAI, how the UiPath Platform enables process transformation, and top use cases that have been implemented at leading retailers. Hear how leading retailers have automated use cases across their respective value chains.', NULL, NULL, NULL, 'https://start.uipath.com/Intelligent-Automation-Trends-in-Retail.html', '2025-10-30 11:31:04', '2025-10-30 11:31:04'),
(973, 'UiPath', 'Webinar', 'Elevate Epic Testing with UiPath Test Suite', 'Join the UiPath Test Suite team for an exclusive webinar about how you can leverage Test Suite, the automated testing tool powered by the UiPath Business Automation Platform, to ensure patient safety, regulatory compliance, and operational efficiency through testing your Epic application.', NULL, NULL, NULL, 'https://start.uipath.com/Elevate-Epic-Testing-with-UiPath-Test-Suite.html', '2025-10-30 11:31:04', '2025-10-30 11:31:04'),
(974, 'UiPath', 'Webinar', 'How hospital finance leaders are fueling improvements with intelligent technology', 'Join this interactive panel discussion with finance leaders from leading hospitals. These leaders will share their organizations\' top priorities for revenue integrity and how they\'re leveraging tools like artificial intelligence and automation.', NULL, NULL, NULL, 'https://start.uipath.com/How-hospital-finance-leaders-are-fueling-improvements-with-intelligent-technology.html', '2025-10-30 11:31:04', '2025-10-30 11:31:04'),
(975, 'UiPath', 'Webinar', 'Reducing time to market with AI Powered Automation', 'What strategies are life sciences organizations using to reduce costs and accelerate time to market? In this webinar, UiPath Life Sciences Industry Director Joe Miles and CGI Life Sciences Industry Practice Vice President Michael Schafer will explore how life sciences companies can leverage AI-powered automation.', NULL, NULL, NULL, 'https://start.uipath.com/Reducing-time-to-market-with-AI-Powered-Automation.html', '2025-10-30 11:31:04', '2025-10-30 11:31:04'),
(976, 'UiPath', 'Webinar', 'UiPath Coffee Chat with Mayo Clinic', 'Join Jared to learn how Mayo Clinic is using AI and RPA to collaborate across teams ensuring they optimize existing infrastructure as well as focus on high dollar initiatives to maximize their investments.', NULL, NULL, NULL, 'https://start.uipath.com/Coffee-Chat-with-Mayo-Clinic.html', '2025-10-30 11:31:04', '2025-10-30 11:31:04');
